import React from 'react'
import bg from '../assets/coffee_images/bg.jpg';


const Home = () => {


    return (
        <section id='home' className='h-screen w-screen relative scroll-smooth overflow-x-hidden'>
            <div className='absolute top-0 left-0 h-full w-full z-[1]'>
                <img src={bg} alt="profile_pic" className='object-cover' style={{width}}/>
            </div>
            <div>
                <h1>Better Coffeeee</h1>
                <p>Fresh place to drink a cuppa</p>
            </div>
        </section>


  )
}

export default Home
